import React, { useState } from 'react';

const App = () => {

    let [user, setUser] = useState({
        uname : "",
        upass : "",
        email : "",
        phone : "",
        finalName : "",
        finalPass : "",
        finalEmail : "",
        finalPhone : ""
    });

    const onSubmits = (event) => {
        event.preventDefault();
        setUser((prev) => {
            return {
                finalName: prev.uname,
                finalPass: prev.upass,
                finalEmail : prev.email,
                finalPhone : prev.phone
            }
        })
    }

    const inputEvent = (event) => {
        const {name, value} = event.target;
        console.log(value);
        console.log(name);
        setUser((prev) => {
            return {
                ...prev,
                [name] : value
            }
        })
    }

    return (
        <>
            {/* <div className="main_div"> */}
                <form onSubmit={onSubmits}>
            <div>
                <h1> Hello {user.finalName} {user.finalPass}</h1>
                <br/>
                <p>{user.finalEmail}</p><br />
                <p>{user.finalPhone}</p>
                <input 
                    type='text' 
                    placeholder="Enter Your Name"
                    name="ufname"
                    onChange={inputEvent} 
                    value={user.uname}
                />
                <input 
                    type='text' 
                    placeholder="Enter Your Password"
                    name="ufpass"
                    onChange={inputEvent} 
                    value={user.upass}
                />
                <input 
                    type='email' 
                    placeholder="Enter Your Email"
                    name="email"
                    onChange={inputEvent} 
                    value={user.email}
                />
                <input 
                    type='number' 
                    placeholder="Enter Your Phone"
                    name="phone"
                    onChange={inputEvent} 
                    value={user.phone}
                />
                <button type="submit"> Submit </button>
            </div>
            </form>
            {/* </div> */}
        </>
    );
}

export default App;
